import {Col,Row} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/sass/header.scss';

const Header =()=>{
 return (
     <Row className='header'>
         <Col>
         Imagen
         </Col>
         <Col>
         Buscador
         </Col>
         <Col>
         Boton
         </Col>
     </Row>
    );
}
export default Header;
